import { CategoryI, DataBaseI, WordI } from './interfaces'

const data: DataBaseI = {
  categories: [
    {
      id: 0,
      name: '123',
      image:
        'data:image/jpeg;base64,',
    },
  ],
  words: [
    {
      category: 0,
      word: 'sad',
      translate: 'asda',
      image: 'ad',
      audio: 'asd',
    },
  ],
}

const newId = (() => {
  let id = data.categories.length
  return function (): number {
    return id++
  }
})()

export function getCategories() {
  return data.categories
}

export function createCategory(name: string, image: string) {
  const newCategory: CategoryI = {
    id: newId(),
    name: name,
    image: image,
  }
  data.categories.push(newCategory)
}

export function removeCategory(id: number) {
  const index = data.categories.findIndex((el) => el.id === id)
  data.categories.splice(index, 1)
}

export function updateCategory(category: CategoryI) {
  const index = data.categories.findIndex((el) => el.id === category.id)
  data.categories[index] = category
}

export function getWords() {
  return data.words
  // category: number
  // data.words.filter((word) => {
  //   word.category === category
  // })
}

export function createWord(newWord: WordI) {
  data.words.push(newWord)
}

export default data
